import { useState, useEffect } from 'react';
const Client = () => {
  const [data, setData] = useState(null);
  fetch('http://localhost:4000/api/data')
    .then((response) => response.json())
    .then((data) => setData(data));
  return <div>임시</div>;
};
export default Client;
